import React from 'react';
import FlipSticker from '../assets/img/Flip-Sticker.png';

class Flip extends React.Component{
    render(){
        return(
            <div>
                <div className="flip-intro-image">
                    <img src={FlipSticker} alt="Flip Logo"/>
                    <ul>
                        <li>María Eugenia Pienovi</li>
                        <li>Laura Mañes</li>
                        <li>Javier Martinez</li>
                        <li>Marc Martinez</li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default Flip
